import React from 'react';
import imgSrc from '../../utils/images/'

const Customer = ({imageBase64, isGold, name, phone}) => {
   
    return (
        <>
            <img src={`../../utils/images/${imageBase64}`}/>
            <h3>{name}</h3>
            <p>{phone}</p>
            <p>Is Gold: {isGold ? 'yes' : 'no'}</p>
        </>
    )
}

export default Customer;
